import React, { useState } from "react";
import "./project.css";
import UniqueProject from "../../components/uniqueProject/UniqueProject";

function Project({ item }) {
  return (
    <div className="project">
      {item.map((it) => {
        return <UniqueProject it={it} />;
      })}
    </div>
  );
}

export default Project;
